import { useState } from "react";
import * as S from "./styles";

export function Home() {
  const [isOpenPopUp, setIsOpenPopUp] = useState(false);

  function onOpenPopUp() {
    setIsOpenPopUp(!isOpenPopUp);
  }
  return (
    <S.Container>
      <div className="App">
        <button
          onClick={() => {
            onOpenPopUp(true);
          }}
        >
          Entrar
        </button>
        <br />
        <br />
        {isOpenPopUp && <text>Hello </text>}

        <ul>
          <li>Bottoes</li>
          <li>Efeito click</li>
          <li>Navegaçao</li>
          <li>Usar Theme</li>
          <li>Animaçoes</li>
          <li>Outros</li>
        </ul>
      </div>
    </S.Container>
  );
}
